import React from "react";
import {Link} from "react-router-dom";
import NavLinks from "./NavLinks";

function Nav() {

    const fullname = "Timi Ambaye";
    const avatar = "/logo192.png";

    return (
        <nav 
            className="h-20 w-screen bg-gray-300 flex justify-center shadow-sm"
        >

            <div className="w-5/6 h-full flex flex-between">

                <NavLinks />

                <div className="flex bg-red-300 w-2/5 items-bottom">
                    <span>
                        Hello {fullname}
                    </span>

                    <img 
                        src={avatar} 
                        alt="User avatar" 
                        className="w-10 h-10 ml-2 rounded-full bg-gray-500" 
                    />

                </div>

            </div>
        </nav>
    );
}

export default Nav;
